import React, {useEffect} from 'react';
import './App.scss';
import {Provider} from "react-redux";
import {store} from "./redux/store/store";
import axios from "axios";
import {useActions} from "./hooks/useActions";

const App: React.FC = () => {
    const {fetchWeater} = useActions()
    useEffect(()=>{
        axios.get('https://weather.visualcrossing.com/VisualCrossingWebServices/rest/services/timeline/kyiv?unitGroup=metric&key=KXLCQFR4Q8PKE8LW86YXF7QWD&contentType=json').then(res=>console.log(res));
    },[]);
    return (
        <Provider store={store}>
            <div className="App">
                <h1>Works</h1>
            </div>
        </Provider>
    );
}

export default App;
